import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-links">
        <li><Link to="/main">Main Page</Link></li>
        <li><Link to="/prayer-times">Prayer Times</Link></li>
        <li><Link to="/daily-prayers">Daily Prayers</Link></li>
        <li><Link to="/hadiths">Hadiths</Link></li>
        <li><Link to="/dhikr">Dhikr</Link></li>
        <li><Link to="/names-of-allah">Names of Allah</Link></li>
        <li><Link to="/quran-verses">Quran Verses</Link></li>
        <li><Link to="/profile">Profile</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
